INSERT INTO `adminnotification_inbox` (`notification_id`, `severity`, `date_added`, `title`, `description`, `url`, `is_read`, `is_remove`) VALUES(2, 1, '2018-09-18 17:51:37', 'Magento Open Source 2.2.6 delivers important security updates along with performance and functionality enhancements – 9/18/2018', 'The latest release of Magento Open Source includes important security enhancements along with performance and functionality improvements. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the enhancements. For more information about security updates included in these versions of Magento please see our Security Center: https://magento.com/security/patches/magento-2.2.6-and-2.1.15-security-update', 'https://devdocs.magento.com/guides/v2.2/release-notes/bk-release-notes.html', 0, 0);
INSERT INTO `adminnotification_inbox` (`notification_id`, `severity`, `date_added`, `title`, `description`, `url`, `is_read`, `is_remove`) VALUES(3, 2, '2018-09-27 10:19:45', 'PHP 7.2 support patches are now available for Magento 1', 'PHP 7.2 support patches for Magento 1 are now available. It is critical you are on a supported version of PHP to ensure your site is secure and in compliance. For compatibility and download details, please visit our developer forum post.\n\nhttps://community.magento.com/t5/News-Announcements/PHP-7-2-Support-Patches-for-Magento-1-are-now-available/m-p/106999#M211', 'https://community.magento.com/t5/News-Announcements/PHP-7-2-Support-Patches-for-Magento-1-are-now-available/m-p/106999#M211', 0, 0);
INSERT INTO `adminnotification_inbox` (`notification_id`, `severity`, `date_added`, `title`, `description`, `url`, `is_read`, `is_remove`) VALUES(4, 1, '2018-11-28 15:33:26', 'Magento Commerce 1.9.4.0 adds PHP 7.2 support along with security enhancements – 11/28/2018', 'The latest release of Magento Open Source 1 adds support for PHP 7.2 and delivers important security enhancements. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about these enhancements. For more information about security updates included in this version of Magento please see our Security Center: https://magento.com/security/patches/supee-10975', 'https://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html', 0, 0);
INSERT INTO `adminnotification_inbox` (`notification_id`, `severity`, `date_added`, `title`, `description`, `url`, `is_read`, `is_remove`) VALUES(5, 4, '2018-12-12 16:38:11', 'What does 2019 look like for you? Take our Retail Trends survey!', 'Let us know what\'s important to you and your business in 2019!\n\nWe invite you to take our retail trends survey which should take no more than a few minutes to complete. As always, any individual information you provide will remain strictly confidential.\n\nYou can take the survey at: \nwww.surveymonkey.com/r/GHNQTJ2', 'https://www.surveymonkey.com/r/GHNQTJ2', 0, 0);

